selector_to_html = {"a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Kontinuierlicher Modus<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>Wenn der Scanner erfolgreich ist oder die Scanzeit die Arbeitszeit \u00fcberschreitet, endet der aktuelle Scanner. Wenn die Zeit die angegebene Zeit \u00fcberschreitet, wird der n\u00e4chste Scan automatisch ausgel\u00f6st.</p>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Automatischer Sensormodus<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>Im Automatik-Sensing-Modus erkennt der Scanner die Helligkeit der umgebenden Umgebung. Wenn sich die Helligkeit \u00e4ndert, wird der Scan ausgel\u00f6st. Der Scan endet wenn der Scan erfolgreich ist oder die Scanzeit die Arbeitszeit \u00fcbersteigt. Unabh\u00e4ngig davon, ob der letzte Scan erfolgreich war oder fehlgeschlagen ist, wird die Helligkeit der umgebenden Umgebung erneut erkannt.</p>", "a[href=\"barcode.html#china-post\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">China-Post<a class=\"headerlink\" href=\"#china-post\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id29\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-limited-rss-limited\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1 DataBar limitiert(RSS Limited)<a class=\"headerlink\" href=\"#gs1-databar-limited-rss-limited\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id21\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Scan-Modus<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Tastentrigger-Modus<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Dr\u00fccken Sie die Schaltfl\u00e4che, um das Scannen auszul\u00f6sen, und lassen Sie die Taste zum Scannen frei. Das Scannen endet wenn der Scan erfolgreich ist oder die Lesezeit die einzelne Lesezeit \u00fcbersteigt.</p>", "a[href=\"character.html#transmit-code-id-character\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">\u00dcbertrage Code ID Zeichen<a class=\"headerlink\" href=\"#transmit-code-id-character\" title=\"Link to this heading\">#</a></h2><p>Ein Code-ID-Zeichen identifiziert den Code-Typ eines gescannten Barcodes. Dies kann n\u00fctzlich sein, wenn mehrere Code-Typen dekodiert werden. Das Code-ID-Zeichen wird zwischen dem Pr\u00e4fix Zeichen (falls ausgew\u00e4hlt) und dem dekodierten Symbol eingef\u00fcgt.</p>", "a[href=\"barcode.html#interleaved-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Interleaved 2 von 5<a class=\"headerlink\" href=\"#interleaved-2-of-5\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id24\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-11\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 11<a class=\"headerlink\" href=\"#code-11\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id13\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-expanded-rss-expanded\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1 DataBar erweitert (RSS erweitert)<a class=\"headerlink\" href=\"#gs1-databar-expanded-rss-expanded\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id23\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Tastatureinstellungen<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Tastatursprache<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Amerikanisch<a class=\"headerlink\" href=\"#american\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Symbologien<a class=\"headerlink\" href=\"#symbologies\" title=\"Link to this heading\">#</a></h1><h2>Umgekehrte Symbole<a class=\"headerlink\" href=\"#reverse-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#ean-8\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-8<a class=\"headerlink\" href=\"#ean-8\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#enable-disable\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#yx-ccd-wired-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><strong>YX-CCD</strong> kabelgebundene Scanner-Schnelleinstellungsanleitung<a class=\"headerlink\" href=\"#yx-ccd-wired-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"barcode.html#plessey-telepen\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Plessey/Telepen<a class=\"headerlink\" href=\"#plessey-telepen\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id34\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html#end-character-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">End-Charakter-Einstellungen<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>Das End-Zeichen wird nach den dekodierten Daten im Format der dekodierten Daten + End-Zeichen hinzugef\u00fcgt.</p>", "a[href=\"barcode.html#reverse-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Umgekehrte Symbole<a class=\"headerlink\" href=\"#reverse-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Lautst\u00e4rke-Einstellungen<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><p>Scannen Sie den entsprechenden Einstellungscode, um die Sound-Eingabeaufforderung des Scanners einzu-/auszuschalten</p>", "a[href=\"barcode.html#msi\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">MSI<a class=\"headerlink\" href=\"#msi\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id30\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Standardeinstellungen wiederherstellen<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Wenn ein unbekannter Fehler auf dem Scanner auftritt, k\u00f6nnen Sie den Scanner zur\u00fccksetzen, indem Sie die Standardeinstellungen wiederherstellen.</p>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tastatursprache<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Amerikanisch<a class=\"headerlink\" href=\"#american\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-39\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 39<a class=\"headerlink\" href=\"#code-39\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id14\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Terminator<a class=\"headerlink\" href=\"#terminator\" title=\"Link to this heading\">#</a></h1><h2>End-Charakter-Einstellungen<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>Das End-Zeichen wird nach den dekodierten Daten im Format der dekodierten Daten + End-Zeichen hinzugef\u00fcgt.</p>", "a[href=\"barcode.html#ean-13\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-13<a class=\"headerlink\" href=\"#ean-13\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#upc-e\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-E<a class=\"headerlink\" href=\"#upc-e\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id9\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Systemeinstellungen<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Standardeinstellungen wiederherstellen<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Wenn ein unbekannter Fehler auf dem Scanner auftritt, k\u00f6nnen Sie den Scanner zur\u00fccksetzen, indem Sie die Standardeinstellungen wiederherstellen.</p>", "a[href=\"barcode.html#industrial-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Industrielle 2 von 5<a class=\"headerlink\" href=\"#industrial-2-of-5\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id27\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 128<a class=\"headerlink\" href=\"#code-128\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id19\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#upc-a\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-A<a class=\"headerlink\" href=\"#upc-a\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id5\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-93\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 93<a class=\"headerlink\" href=\"#code-93\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id17\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Holen Sie sich die Firmware-Version<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#codabar\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codabar<a class=\"headerlink\" href=\"#codabar\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id12\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#duplicate-barcode-detection-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Barcode-Erkennungseinstellungen duplizieren<a class=\"headerlink\" href=\"#duplicate-barcode-detection-settings\" title=\"Link to this heading\">#</a></h2><h3>Deaktivieren<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#matrix-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Matrix 2 von 5<a class=\"headerlink\" href=\"#matrix-2-of-5\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id28\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-omnidirectional-rss-omnidirectional\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1 DataBar Omnidirectional(RSS Omnidirectional)<a class=\"headerlink\" href=\"#gs1-databar-omnidirectional-rss-omnidirectional\" title=\"Link to this heading\">#</a></h2><h3>Aktiviere/Deaktivieren<a class=\"headerlink\" href=\"#id22\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tastentrigger-Modus<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Dr\u00fccken Sie die Schaltfl\u00e4che, um das Scannen auszul\u00f6sen, und lassen Sie die Taste zum Scannen frei. Das Scannen endet wenn der Scan erfolgreich ist oder die Lesezeit die einzelne Lesezeit \u00fcbersteigt.</p>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
